import React from 'react';

function OldCustomer() {

    function getOldCustomerData() {
        const customerId = document.getElementById('customerId').value;
    
        fetch('http://localhost:5000/predict', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({cust_id: customerId})
        })
        .then(response => response.json())
        .then(data => {
            if (data.error) {
                alert("Error: " + data.error);
            } else {
                document.getElementById('results').value = "Cluster for customer with ID " + customerId + ": " + data.cluster;
            }
        });
    }
    return(
        <div className='container'>
            <div className='row'>
            <div class="input-group mb-3">
  <input type="text" class="form-control" placeholder="Customer ID" aria-label="Username"/>
  <span class="input-group-text">Customer ID</span>
  <input type="text" class="form-control" placeholder="Server" aria-label="Server"/>
</div>

<div class="input-group">
  <span class="input-group-text">With textarea</span>
  <textarea class="form-control" aria-label="With textarea"></textarea>
</div>
        <label htmlFor="customerId">Customer ID:</label>
        <input type="text" id="customerId" />
    <br />
      <div>
        <label>Results:</label>
        <textarea readOnly id="results"></textarea>
      </div>
    <br />
    <div style={{textAlign: "center"}}>
        <button onClick={getOldCustomerData}>Fetch Data</button>
    </div>
    </div>
  
    </div>
    )
}
export default OldCustomer;
